column8:
原材料：<br>
砂糖、食塩、コラーゲンペプチド（豚）、バラの花びらエキス末、酸味料、香料、<br>
甘味料（アセスルファムＫ、スクラロース、アスパルテーム・Ｌ－フェニルアラニン化合物）、<br>
着色料（野菜色素）、ビタミンＣ<br>
<br>
賞味期限：540日<br>
<br>
アレルギー物質（25品目中）：豚<br>
<br><br>
商品特長：女性の注目が高い、エチケット、ビューティー、リラックスの要素を持つ商品です。<br>
1.エチケットに・・・カラダから甘い香りが出る、バラの香り成分を配合。<br>
汗をかく時期にぴったりのエチケット飲料です。<br>
2.ビューティーに・・・・コラーゲン、ビタミンＣを配合。<br>
汗をかく＆冷房乾燥する夏場の美肌ニーズにこたえます。アロマセラピーではローズの香りは、ホルモンバランスを整え美肌に導くといわれています。<br>
3.リラックスに・・・ダマスクローズオイル、バラの花びらエキス配合<br>
ローズの香りには、抗ストレス、リラックス効果があるといわれています。<br>
香り高くバラの女王といわれる「ブルガリア産ダマスクローズ」オイル使用<br>
4.飲むとローズの香りが拡がり、甘酸っぱく飲み飽きないおいしさ。<br>
5.内装はペットボトルに直接入れやすいスティック形状。<br>
6.調査の結果、約６割の女性が購入したいと答えました。<br><style type="text/css">
